CREATE TABLE `cms_category` (
  `id` bigint(20) unsigned NOT NULL AUTO_INCREMENT COMMENT '分类id',
  `parent_id` bigint(20) NOT NULL DEFAULT '0' COMMENT '分类父id',
  `model_id` int(10) unsigned NOT NULL DEFAULT '0' COMMENT '模型ID',
